(1132, 'STBOB25: Breakout Box', 'Specialty Tools', 'The Breakout Box (BoB) interfaces with any telephony card that requires a standard breakout box between cables and analog telephony circuitry. The Breakout Box features:_x000D_\n_x000D_\n-25 RJ-11 Jacks_x000D_\n-Fully compatible with both male and female connectors_x000D_\n-Includes cable gripper, double stick pads, and screws', '$105.00 ', 'TheBreakoutBox(BoB)interfaceswithanytelephonycardthatrequiresastandardbreakoutboxbetweencablesandanalogtelephonycircuitry.TheBreakoutBoxfeatures:_x000D_\n_x000D_\n-25RJ-11Jacks_x000D_\n-Fullycompatiblewithbothmaleandfemaleconnectors_x000D_\n-Includescablegripper,doublestickpads,andscrews', 'TheBreakoutBox(BoB)interfaceswithanytelephonycardthatrequiresastandardbreakoutboxbetweencablesandanalogtelephonycircuitry.TheBreakoutBoxfeatures:_x000D_\n_x000D_\n-25RJ-11Jacks_x000D_\n-Fullycompatiblewithbothmaleandfemaleconnectors_x000D_\n-Includescablegripper,doublestickpads,andscrews', 0, '0'),
